const Error404 = () => {
  return (
    <div>
      <div className="page-404 bg-red-700 w-full h-[100vh] absolute top-1/2 left-1/2 translate-x-[-50%] translate-y-[-50%]">
        <h1 className="text-center text-white font-bold text-[150px]">404</h1>
        <p className="text-xl text-center text-white">
          WE ARE SORRY, BUT THE PAGE YOUR REQUESTED WAS NOT FOUND
        </p>
      </div>
    </div>
  );
};

export default Error404;
